import { styled } from '@mui/material/styles'

export const StyledNavbar = styled('nav')`
    background-color: darkblue;
    margin: 0;
    display: grid;
    grid-template-columns: auto auto auto auto auto;
    align-items: center;
    gap: 10px;

    h1 {
        font-size: 75px;
        color: red;
    }

    h6 {
        color: red;
    }

    p {
        color: white;
    }
`

export const StyledDivList = styled('div')`
    display: flex;
    align-items: center;
`
